import { useState } from 'react'
import PropTypes from 'prop-types'

// import UI components
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  NavbarText
} from 'reactstrap';

const Header = props => {
  const [isOpen, setIsOpen] = useState(false);
  const toggle = () => setIsOpen(!isOpen);

  return (
    <header>
      <h1 className="brand">Dr. Help</h1>
      <ul className="navbar">
        <li className="nav-item">Forum</li>
        <li className="nav-item">Works</li>
        <li className="nav-item">Academic Subjects</li>
        <li className="nav-item">Universities</li>
        <li className="nav-item">Sign In</li>
        <li className="nav-item">Register</li>
      </ul>
    </header>
  )
}

Header.propTypes = {

}

export default Header
